import axios from 'axios'

/*
* 发送请求获取成绩数据*/
const request = (studentID, studentPassword) =>{
  let Api = '';
  axios.post(
      Api,
      {
        studentID: studentID,
        studentPassword: studentPassword,
  })
      .then(function (response) {
        return({
          studentDataResult: response,
        });
      })
      .catch(function (error) {
        console.log(error);
      });
};

export default request();
